/* The data in this table define all the known flex configurations for       */
/* Falcon-based (and follow-on) sensors.                                     */
/* The fields defined here are:                                              */
/* AcqChannel  - the channel number shown by a vfsAcq-type tool. Basically,  */
/*               the zero-based byte within the line that the indicator      */
/*               shows up in.                                                */
/* DataChannel - The zero-based byte within the data portion of a line that  */
/*               the indicator shows up in. Same as (AcqChannel - 8)         */
/* Conf        - alternate configuration for the same FlexNumber             */
/* FlexNumber  - The Flex Number referenced in the GetPrint configuration    */
/*               files.  Normally the same as DataChannel, but can be        */
/*               different in the case of second sources for the same flex.  */
/* SO_TX       - The SO number used as a transmitter.                        */
/* PID         - The PID of the silicon. Set to 0x0000 if don't care.        */
/* ProjId      - Project ID programmed into the sensor OTPROM                */
/* ProjIdMask  - Specify a mask to apply before matching the ProjId field    */
/* FlexName    - the friendly name of the flex, displayed by Info utilities  */
/* Pixels      - The maximum number of primary pixels supported by the flex  */
/* Package     - The type of package/die: COF, WLFO, Glass, etc)             */
/* Supplier    - The manufacturing supplier (ie: Hitachi, Kinsus, etc)       */
/* Comments    - Comment field, not normally displayed.                      */

